import axios from "axios";
import HamburgerMenu from "../components/HamburgerMenu";
import { UserInfo } from "../components/UserInfo";
import PhotoGrid from "../components/PhotoGrid";
import { useEffect, useReducer } from "react";
export const MyPage = () => {
    const username = "keigo"
    let photo
    const selectLikedPhotos = async () => {
        try {
            const response = await axios.get("http://localhost:8080/selectLikedPhoto", {
                params: {
                    username: username
                }
            });
            photo = response.photo
        } catch (error) {
            console.error("CannotSelectLikedPhoto", error)
        }
    }
    useEffect(() => {
        selectLikedPhotos();
    }, []);
    return (
        <div className="app-container">
            <div className="sidebar">
                <HamburgerMenu menu1="MyPage" menu2="Logout" />
            </div>
            <div className="userInfoContainer">
                <UserInfo sentence="お気に入りの空を見つけよう！" />
            </div>
            <div className="content">
                {photo && < PhotoGrid photos={photo} username={username} />}
            </div>
        </div>

    );
}
